import './App.css';

const App = () => {
  const name= null;
  const isNameShowing= false;
  return(

    <div className='App'>

    <h1>{name}</h1>
      {
        name?(
          <>
          hi
          </>
        ) :
        (
          <>
          <h1>test</h1>
          <h2>there is no name</h2></>

        )
      }
    </div>
  );
}

export default App;
